import React, { useState, useEffect } from "react";
// import axios from "axios";

var APOD = () => {
  const [data, setData] = useState(null);
  useEffect(() => {
    getData();
    async function getData() {
      const res = await fetch(`https://api.nasa.gov/planetary/apod?api_key=m5qSFJLeqz6oshoKMC0S8QChxUfWerz4VdqOiFo8`);
      const dataNew = await res.json();
      setData(dataNew);
      console.log(dataNew);
    }
  }, []);

  if(!data) return <h1>no data :(</h1>

  return (
    <>
      <div className="card lg:card-side main-card card-bordered">
        <figure>
          <img src={data.hdurl} className="apod" />
        </figure>
        <div className="card-body">
          <h2 className="card-title">{data.title}</h2>
          <p>{data.exlpanation}</p>
          <div className="card-actions">
            <button className="btn btn-primary">Get Started</button>
            <button className="btn btn-ghost">More info</button>
          </div>
        </div>
      </div>
    </>
  );
};
export default APOD;
